insert into Cadastre.CadastraleDivisions (Hierarchie, Nom, Shape)
	select	cast(CD.Hierarchie.ToString() + cast(Z.Id as varchar(5)) + '/' as hierarchyid),
			Z.Nom,
			Z.Shape
	from Zone as Z join Cadastre.CadastraleDivisions as CD on Z.Id_Dep = CD.Id and Cd.Niveau = 1;
	
--Sector
with CadSectorSrc
as
(
	select *
	from (VALUES(3, 1, 4, N'GODOMEY', ),
				(3, 1, 5, N'HÈVIÉ', ),
				(3, 1, 7, N'OUÈDO', ),
				(3, 1, 8, N'TOGBA', ),
				(3, 1, 2, N'AKASSATO', ),
				(3, 1, 3, N'GOLO-DJIGBÉ', ),
				(3, 1, 9, N'ZINVIÉ', ),
				(3, 1, 6, N'KPANROUN', ),
				(3, 1, 1, N'ABOMEY-CALAVI', )
		 ) as Sector (Dep, Zone, Sector, Name, Shape)
),
CadSector
as
(
	select	S.Name, 
			cast((D.Hierarchie.ToString() + cast(S.Sector as varchar(2)) + '/') as hierarchyid) as Hierarchie,
			cast(S.Shape as geometry) as Shape				
	from CadSectorSrc as S join Cadastre.CadastraleDivisions as D on 
								D.Shape.STContains(cast(S.Shape as geometry).STCentroid()) = 1 and
								D.Niveau = 2
)	
insert into Cadastre.CadastraleDivisions (Hierarchie, Nom, Shape)
	select Hierarchie, Name, Shape from CadSector;


